import Cities from '../cities.json';
import '../style1.css';
import '../style.css';
import React , {Component} from 'react';

class Table extends Component  {
//البناء
constructor(){
super()
this.state = {
    elems: [] ,
    Citieslength: Cities.length ,
    notesonpaeg : 5 ,

}


}





 //الكتابه 
render() { 
  
 for (var a = 1 ; a <= this.state.Citieslength / this.state.notesonpaeg  ; a++ ){
    this.state.elems.push(<li id="pagintion-li" key={a} onClick={elem}>{a}</li>)
    } 
function elem(){
    let kay = this.state.elems[1]
    console.log(kay)

}

    return(
        <div>
            <table id="table" >
            <tbody>    
                <tr>
            <td  >المدن</td>
            <td >عدد السكان</td>
                </tr>
        {Cities.map(function data(d) {
        
        
            return(
        
                <tr key={d.id} >
                    <td >{d.citie}</td>
                    <td >{d.peples}</td>
                    <td>
                    <button > تعديل </button> 
                    <button  id = "delet"> حدف  </button> 
                    </td>
                </tr>
                    )   
                })}
            </tbody>
            </table>
        <div>
        <ul id="pagintion-ul">
            {this.state.elems}
        </ul>
        </div>
    
        </div>
        )

}
}
export default Table;
